Artist:  Rebekah Isaacs
Colorist:  Dan Jackson
Letterer:  Richard Starkings and Jimmy Betancourt
Cover:  Steve Morris
Alternate Cover:  Rebekah Isaacs with Dan Jackson

Faith faces off against a troubled Slayer and the Irish mob, which is no easy task with a visitor from her past clouding her thoughts! Even with support from Angel, will Faith be able to maintain her sanity and follow her new righteous path or will she take the easy route and fall back on her old, murderous tendencies? Angel &amp; Faith series writer Christos Gage (Avengers Academy) and series artist Rebekah Isaacs (DV8) are bringing the blood and the pain!

